import React, { useState } from "react";

import "./FinanceItemList.css";
import FinanceItem from "./FinanceItem";
import Card from "../General UI/Card";
import FinanceFilter from "./FinanceFilter";

const FinanceItemList = (props) => {
  //console.log(JSON.stringify(props.financeItems));

  const [filteredYear, setYear] = useState();

  let financeItemsJSX = props.financeItems.map((fi) => (
    <FinanceItem
      title={fi.title}
      date={fi.date}
      price={fi.price}
      currency={fi.currency}
    ></FinanceItem>
  ));

  const filterChangedHandler = (enteredFilter) => {
    setYear(enteredFilter);
    console.log("PSV: " + enteredFilter);
  };

  return (
    <Card className="finance_list">
      <FinanceFilter onFilterChange={filterChangedHandler} />
      {financeItemsJSX}
    </Card>
  );
};

export default FinanceItemList;
